// src/Outcome.js
import React from 'react';

function Outcome({ programs }) {
  return (
    <div>
      <h2>Based on your answers, you may be eligible for the following programs:</h2>
      <ul>
        {programs.map((program) => (
          <li key={program}>{program}</li>
        ))}
      </ul>
    </div>
  );
}

export default Outcome;
